import React from 'react';
import Point from './Point.js';
import Button from './Button.js';
import { BrowserRouter, Route, NavLink } from 'react-router-dom';
import { MDBContainer, MDBRow, MDBCol, MDBFormInline, MDBIcon, MDBBtn } from "mdbreact";
import '../Styles/Item.css';



export class Item extends React.Component{
    constructor(props){
        super(props);
    }
    //props:
    //props are the Host data points and match the data point names

    render(){
      const bookButtonAttr={
        'type':"button",
        'class':"btn btn-primary"
      }
      const bookButtonLabel="Book";
    //  const {...props} = this.props;
      let data = {pathname: '/details', id: this.props.id }

        return(

      <div key={this.props.id}>
        <MDBContainer className="item-whole">
            <MDBRow>
							<h4 className="item-title">{this.props.firstName}</h4>
            </MDBRow>
            <MDBRow className="item-info">
              <MDBCol size="sm">
                <h1> hi</h1>
              </MDBCol>
              <MDBCol size="sm">
                  <Point id = "item-point" dataDisplay={this.props.street} gIcon = "glyphicon-map-marker"/>
                  <Point id = "item-point" dataDisplay={this.props.spaceType} gIcon = "glyphicon-home"/>
                  <Point id = "item-point" dataDisplay={this.props.pricePerSq + "/sqInch"} gIcon = "glyphicon-usd"/>
						  </MDBCol>
              <MDBCol size="sm">
                <div className="item-button">
                  <NavLink to={data}><MDBBtn id="row-bookButton">details</MDBBtn></NavLink>
                </div>
              </MDBCol>
            </MDBRow>

</MDBContainer>
          </div>



        );
    }


}
export default Item;
